import TextBar from './TextBar';
const socket = socketIO.connect('http://localhost:50051');

function App() {


  useEffect(() => {
    console.log("socket updated");
    socket.emit('join', "123");
  },[]);

  return (
    <div className="App">
      <Message userName="test_user_1" message="Tired"/>
